@maximuscurry competed with the high schoolers today at @nationalplaymakersacademy combine/camp.  He showed out. 

5th grade and 11 years old stats at his first ever combine experience. He hasn’t been tested for any of these things before but I’d say he did pretty good for a youngin’. Never did a broad jump before either. Now we know what he needs to work on and where he can continue to improve. 

Grateful for the guidance he has been receiving for the last 2 months.  Shout out to @ballhawku for the work they are putting in with these boys!  As a parent we always want to see our children maximize their talent and ability.

