Tennessee Youth Football League 2020 state championship playing against the club I remember being the club to beat growing up in Nashville-the infamous Bordeaux! 

I’m bored on my flight to Vegas so I’m passing time by watching my kids play sports on videos. Watching my son and his team DOMINATE and win not only the state championship, but then go on and jump into the travel ball circuit post season and sweep through to the top and win the @d1spects National Championship in ATL!  And he topped off the season with 2 MVP awards on a National Championship winning team!  Man...I’m amazed. Just listen to how he drives these crowds wild at every game he steps onto the field. Turn that volume up! 💪🏿

